// frontend/src/components/Backtesting.js
import React from 'react';
import { Container, Typography, Button, TextField, Paper, Grid } from '@mui/material';

const Backtesting = () => {
  const handleBacktest = () => {
    // Implement backtesting logic here
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Backtesting
      </Typography>
      <Paper elevation={3} style={{ padding: '16px', marginBottom: '16px' }}>
        <Typography variant="h6">Backtest a Strategy</Typography>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Strategy Name"
              placeholder="e.g., Moving Average Crossover"
              fullWidth
              margin="normal"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Parameters"
              placeholder="e.g., Short MA: 10, Long MA: 50"
              fullWidth
              margin="normal"
            />
          </Grid>
        </Grid>
        <Button variant="contained" color="primary" fullWidth>Run Backtest</Button>
      </Paper>
      <Typography variant="h6">Backtesting Results</Typography>
      {/* Display backtest results here */}
    </Container>
  );
};

export default Backtesting;
